:{"image/png":{"height":420,"width":420}},"output_type":"display_data"}],"source":["# Visualising the Test set results\n","library(Rfast)\n","set = test_set\n","X1 = seq(min(set[, 1]) - 1, max(set[, 1]) + 1, by = 0.01)\n","X2 = seq(min(set[, 2]) - 1, max(set[, 2]) + 1, by = 0.01)\n","grid_set = expand.grid(X1, X2)\n","colnames(grid_set) = c('Age', 'EstimatedSalary')\n","prob_set = predict(classifier, type = 'response', newdata = grid_set)\n","y_grid = ifelse(prob_set > 0.5, 1, 0)\n","plot(set[, -3],\n","     main = 'Logistic Regression (Test set)',\n","     xlab = 'Age', ylab = 'Estimated Salary',\n","     xlim = range(X1), ylim = range(X2))\n","contour(X1, X2, matrix(as.numeric(y_grid), length(X1), length(X2)), add = TRUE)\n","points(grid_set, pch = '.', col = ifelse(y_grid == 1, 'springgreen3', 'tomato'))\n","points(set, pch = 21, bg = ifelse(set[, 3] == 1, 'green4', 'red3'))"]},{"cell_type":"code","execution_count":19,"id":"e5321f04","metadata":{"execution":{"iopub.execute_input":"2022-03-15T11:03:51.453853Z","iopub.status.busy":"2022-03-15T11:03:51.452445Z","iopub.status.idle":"2022-03-15T11:04:09.438968Z","shell.execute_reply":"2022-03-15T11:04:09.438388Z"},"papermill":{"duration":18.069736,"end_time":"2022-03-15T11:04:09.439101","exception":false,"start_time":"2022-03-15T11:03:51.369365","status":"completed"},"tags":[]},"outputs":[{"data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAAA0gAAANICAIAAAByhViMAAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzdeZwcVbk//uecqurqZfaZzGQyScgKCZBA2LmyyCKIV1GuAopfUUREARHU64LI\nvS64IKgg4i4XuSqXy0X5oYAiKgrIHkIWErLNnlm7p/et6pzfHzNMZpKetZeq7vN5v3i9yNR0\nVz/dc7rOU2dlUkoCAAAAgPLHnQ4AAAAAAAoDiR0AAABAhUBiBwAAAFAhkNgBAAAAVAgkdgAA\nAAAVAokdAAAAQIVAYgcAAABQIZDYAQAAAFQI3ekAZiClHBkZyecMtbW1sVjMtu1ChaQC0zS9\nXq8QIhqNOh1LmamqqspkMplMxulAyomu64FAgIgikQiWTJ8Tn89HRMlk0ulAygljrKamhoji\n8bhlWU6HU048Ho/H44nFYiV7xfr6+pK9VsUog8Quz5yMcy6EQGI3V5zz/D98BTHG8LnNlaZp\nnHMism0bid08oLzNCed8tLzhqzpXUkrGGD40l0NXLAAAAECFQGIHAAAAUCGQ2AEAAABUCCR2\nAAAAABUCiR0AAABAhUBiBwAAAFA